svg.script:
    var NSS = new Object();
    NSS['svg']='http://www.w3.org/2000/svg';

    window.onload = Init

    var alllayers = ['Roman','MA1000','MA1300','MA1600','MA1790','MA1900'];
    var nlayers   = alllayers.length;
    var state     = 'layer1';

    var showlabels = true;

    var gMouseDown = 0;
    var scaleFactor = 2.; 
    var magnifier;
    var magglass;
    var clipframe;  
    var outerframe;
    var innerframe; 
    var root;

    function Init()
    {
        magnifier   = document.getElementById("magnifier");
        magglass    = document.getElementById("magglass");
        clipframe   = document.getElementById("clip_frame");
        outerframe  = document.getElementById("outer_frame");
        innerframe  = document.getElementById("inner_frame");
        root        = document.getElementsByTagNameNS(NSS['svg'], 'svg')[0];

	height = parseFloat(root.getAttribute('height'));
	width  = parseFloat(root.getAttribute('width'));
	root.setAttribute('viewBox', '0 0 ' + width + ' ' + height);

	root.setAttribute('width', '100%');
	root.setAttribute('height', '100%');

	bgcolor = 'black';
	var newAttribute = 'background-color:' + bgcolor + ';';

	if (root.hasAttribute('style'))
		newAttribute += root.getAttribute('style');

	root.setAttribute('style', newAttribute);
    }

    function changeState(newstate) {
        if (newstate == state){newstate = 'layer1';}
        if (state != 'layer1'){
            oldlayer = document.getElementById(state);
            oldlayer.setAttribute('style','display:none');}
        newlayer = document.getElementById(newstate);
        newlayer.setAttribute('style','display:inline');
        state = newstate;
    }

    function toggleLabels() {
        if(state == 'layer1'){return}
        if(showlabels){
            for(var i=0; i < nlayers; i++){
                labels = document.getElementById('labels_'+alllayers[i]);
                labels.setAttribute('opacity',0);}
            showlabels=false;}
        else{
            for(var i=0; i < nlayers; i++){
                labels = document.getElementById('labels_'+alllayers[i]);
                labels.setAttribute('opacity',1);
            showlabels=true;}
            }
    }

    function mouseMove(evt) {
      if(!gMouseDown) return;
      var p = document.documentElement.createSVGPoint();
      p.x = evt.clientX;
      p.y = evt.clientY;

      var m = root.getScreenCTM();
      p = p.matrixTransform(m.inverse());


      clipframe.setAttributeNS(null,"cx",  p.x);
      clipframe.setAttributeNS(null,"cy",  p.y);
      magglass.setAttribute("transform","translate("+p.x+","+p.y+"),scale(1,1)");

      var newx = p.x-scaleFactor*p.x;
      var newy = p.y-scaleFactor*p.y;

      var tx = "translate(" + newx + "," + newy + "),scale(" + scaleFactor + "," + scaleFactor +")";
      magnifier.setAttribute("transform", tx);
    }

    function mouseDown(evt) {
      gMouseDown = 1;
    }

    function mouseUp(evt) {
      gMouseDown = 0;
    }
